export default function Item({ item, onDeleteItem, onToggleItem, onEditItem }) {
  const { description, quantity, packed, id, priority, dueDate } = item;

  const handleToggle = () => onToggleItem(id);
  const handleDelete = () => onDeleteItem(id);

  return (
    <li className={`item ${priority.toLowerCase()}`}>
      <input type="checkbox" checked={packed} onChange={handleToggle} />
      <span>
        {quantity} {description}
      </span>
      {dueDate && <span className="due-date">{dueDate}</span>}
      <button onClick={handleDelete}>Delete</button>
    </li>
  );
}
